import React, { Fragment } from "react";
import { Link } from "react-router-dom";

export default function ProductItem(props) {
    const { product } = props;

    return (
        <Fragment>
            <Link key={product.id} to={"/Audi/" + product.id} className="row cars-sel mb-5" style={{ textDecoration: 'none' }}>
                <img src={product.img} alt={product.name} style={{ borderBottomLeftRadius: '8px', borderTopLeftRadius: '8px' }} className="col-lg-3" />
                <div className="col-lg-9">
                    <h3>{product.name}</h3>
                    <p>{product.price}</p>
                    <button className="btn btn-danger"><i className="fa fa-trash"></i></button>
                </div>
            </Link>



            <h3>Total Price : {product.price + shippingPrice}</h3>
        </Fragment>

    );
}
